create table cliente (
	cod_cliente INT PRIMARY KEY,
	cpf_cliente VARCHAR(11),
	nm_cliente VARCHAR(100),
	dt_nascimento_cliente DATE,
	sexo_cliente CHAR(1),
	logradouro_endereco_cliente VARCHAR(30),
	nm_endereco_cliente VARCHAR(100),
	numero_endereco_cliente VARCHAR(50),
	bairro_endereco_cliente VARCHAR(100),
	cep_endereco_cliente VARCHAR(8),
	cidade_endereco_cliente VARCHAR(50),
	estado_endereco_cliente VARCHAR(2)
);
